   const loadMoreBtn = document.getElementById('mandi-load-more');
   const PAGE_SIZE = 24;
   let currentPage = 1;
   let lastData = [];

   function getFilteredData() {
     const crop = cropSelect.value.trim().toLowerCase();
     const state = stateSelect.value.trim().toLowerCase();
     const district = districtSelect.value.trim().toLowerCase();
   const q = ((searchInput && searchInput.value) ? searchInput.value : '').trim().toLowerCase();

     let filtered = mandiData.filter(item =>
       (!crop || item.Commodity.toLowerCase() === crop) &&
       (!state || item.State.toLowerCase() === state) &&
       (!district || item.District.toLowerCase() === district) &&
       (!q || item.Market.toLowerCase().includes(q) ||
        (item.Variety || '').toLowerCase().includes(q) ||
        item.Commodity.toLowerCase().includes(q))
     );

     switch (((sortSelect && sortSelect.value) ? sortSelect.value : 'modal_desc')) {
       case 'modal_asc':
         filtered.sort((a,b) => (a['Modal_x0020_Price']||0) - (b['Modal_x0020_Price']||0));
         break;
       case 'max_desc':
         filtered.sort((a,b) => (b['Max_x0020_Price']||0) - (a['Max_x0020_Price']||0));
         break;
       case 'min_asc':
         filtered.sort((a,b) => (a['Min_x0020_Price']||0) - (b['Min_x0020_Price']||0));
         break;
       default:
         filtered.sort((a,b) => (b['Modal_x0020_Price']||0) - (a['Modal_x0020_Price']||0));
     }

     return filtered;
   }

   function formatINR(value) {
     try { return new Intl.NumberFormat('en-IN').format(value); } catch { return value; }
   }

   function renderTags() {
     const tags = [];
     if (cropSelect.value) tags.push({ key: 'crop', label: cropSelect.value });
     if (stateSelect.value) tags.push({ key: 'state', label: stateSelect.value });
     if (districtSelect.value) tags.push({ key: 'district', label: districtSelect.value });
     if (searchInput && searchInput.value) tags.push({ key: 'q', label: `Search: ${searchInput.value}` });
     tagsEl.innerHTML = '';
     tags.forEach(t => {
       const b = document.createElement('button');
       b.className = 'px-2 py-1 bg-gray-100 dark:bg-gray-700 rounded text-xs flex items-center gap-1';
       b.innerHTML = `<span>${t.label}</span><span aria-hidden>×</span>`;
       b.addEventListener('click', () => {
         if (t.key === 'crop') cropSelect.value = '';
         if (t.key === 'state') stateSelect.value = '';
         if (t.key === 'district') districtSelect.value = '';
         if (t.key === 'q' && searchInput) searchInput.value = '';
         applyAndRender();
       });
       tagsEl.appendChild(b);
     });
   }

   function renderResults(data) {
     // Cache full filtered set for pagination
     lastData = data;
     currentPage = 1;
     resultsContainer.innerHTML = '';
     countEl.textContent = `${data.length} result${data.length === 1 ? '' : 's'}`;
     if (data.length === 0) {
       resultsContainer.innerHTML = '<p class="col-span-full text-center text-gray-600 dark:text-gray-300">No results found</p>';
       if (loadMoreBtn) loadMoreBtn.classList.add('hidden');
       return;
     }
    // Update summary stats
    const avg = (arr) => arr.length ? Math.round(arr.reduce((a,c)=>a+c,0)/arr.length) : 0;
    const mins = data.map(d=>d['Min_x0020_Price']||0);
    const modals = data.map(d=>d['Modal_x0020_Price']||0);
    const maxs = data.map(d=>d['Max_x0020_Price']||0);
    const avgMin = avg(mins), avgModal = avg(modals), avgMax = avg(maxs);
    const elMin = document.getElementById('stat-avg-min');
    const elModal = document.getElementById('stat-avg-modal');
    const elMax = document.getElementById('stat-avg-max');
    if (elMin) elMin.textContent = `₹${formatINR(avgMin)}`;
    if (elModal) elModal.textContent = `₹${formatINR(avgModal)}`;
    if (elMax) elMax.textContent = `₹${formatINR(avgMax)}`;

    // Update chart bars (Top 5 by modal price)
    const barsWrap = document.getElementById('mandi-chart-bars');
    if (barsWrap) {
      barsWrap.innerHTML = '';
      const sorted = [...data].sort((a,b)=> (b['Modal_x0020_Price']||0) - (a['Modal_x0020_Price']||0)).slice(0,5);
      const maxModal = sorted.length ? sorted[0]['Modal_x0020_Price']||1 : 1;
      sorted.forEach(item => {
        const modal = item['Modal_x0020_Price']||0;
        const pct = Math.max(4, Math.round((modal/maxModal)*100));
        const row = document.createElement('div');
        row.className = 'flex items-center gap-3';
        row.innerHTML = `
          <div class="w-28 text-xs text-gray-700 dark:text-gray-300 truncate">${item.Market}</div>
          <div class="flex-1 h-3 bg-gray-100 dark:bg-gray-700 rounded overflow-hidden">
            <div class="h-full bg-emerald-500" style="width:${pct}%"></div>
          </div>
          <div class="w-20 text-right text-xs font-semibold">₹${formatINR(modal)}</div>
        `;
        barsWrap.appendChild(row);
      });
    }
     const toRender = data.slice(0, PAGE_SIZE);
     const fragment = document.createDocumentFragment();
     toRender.forEach(item => {
       const min = item['Min_x0020_Price'] || 0;
       const modal = item['Modal_x0020_Price'] || 0;
       const max = item['Max_x0020_Price'] || 0;
       const range = Math.max(max - min, 1);
       const modalPos = Math.min(100, Math.max(0, ((modal - min) / range) * 100));

       const card = document.createElement('div');
       card.className = 'bg-white dark:bg-gray-800 border dark:border-gray-700 rounded-xl p-4 shadow-sm hover:shadow-md transition-shadow';
       card.innerHTML = `
         <div class="flex items-start justify-between">
           <div>
             <h3 class="text-lg font-bold">${item.Commodity} <span class="text-gray-500 text-sm">(${item.Variety || '—'})</span></h3>
             <p class="text-sm text-gray-600 dark:text-gray-300">${item.Market}, ${item.District}, ${item.State}</p>
           </div>
           <span class="text-xs px-2 py-1 rounded bg-emerald-100 text-emerald-700 dark:bg-emerald-900/30 dark:text-emerald-300">Modal ₹${formatINR(modal)}</span>
         </div>
         <div class="mt-3">
           <div class="h-2 w-full rounded bg-gradient-to-r from-green-200 via-yellow-200 to-red-200 relative">
             <div class="absolute -top-1 h-4 w-0.5 bg-gray-700" style="left:${modalPos}%"></div>
           </div>
           <div class="grid grid-cols-3 gap-2 mt-2 text-xs">
             <div class="bg-green-50 dark:bg-green-900/20 p-2 rounded">Min<br><span class="font-semibold">₹${formatINR(min)}</span></div>
             <div class="bg-yellow-50 dark:bg-yellow-900/20 p-2 rounded">Modal<br><span class="font-semibold">₹${formatINR(modal)}</span></div>
             <div class="bg-red-50 dark:bg-red-900/20 p-2 rounded">Max<br><span class="font-semibold">₹${formatINR(max)}</span></div>
           </div>
         </div>
       `;
       fragment.appendChild(card);
     });
     resultsContainer.appendChild(fragment);

     // Toggle load more
     if (loadMoreBtn) {
       if (data.length > PAGE_SIZE) loadMoreBtn.classList.remove('hidden');
       else loadMoreBtn.classList.add('hidden');
     }
   }

   function applyAndRender() {
     renderTags();
     const data = getFilteredData();
     renderResults(data);
   }

   document.getElementById('applyFilter').addEventListener('click', applyAndRender);
   if (sortSelect) { sortSelect.addEventListener('change', applyAndRender); }
   if (searchInput) {
     searchInput.addEventListener('keyup', (e) => { if (e.key === 'Enter') applyAndRender(); });
   }
   if (clearBtn) {
     clearBtn.addEventListener('click', () => {
       cropSelect.value = '';
       stateSelect.value = '';
       districtSelect.value = '';
       if (searchInput) searchInput.value = '';
       if (sortSelect) sortSelect.value = 'modal_desc';
       applyAndRender();
     });
   }

  if (loadMoreBtn) {
    loadMoreBtn.addEventListener('click', () => {
      const nextPage = currentPage + 1;
      const start = (nextPage - 1) * PAGE_SIZE;
      const end = nextPage * PAGE_SIZE;
      const chunk = lastData.slice(start, end);
      if (!chunk.length) return;
      const fragment = document.createDocumentFragment();
      chunk.forEach(item => {
        const min = item['Min_x0020_Price'] || 0;
        const modal = item['Modal_x0020_Price'] || 0;
        const max = item['Max_x0020_Price'] || 0;
        const range = Math.max(max - min, 1);
        const modalPos = Math.min(100, Math.max(0, ((modal - min) / range) * 100));
        const card = document.createElement('div');
        card.className = 'bg-white dark:bg-gray-800 border dark:border-gray-700 rounded-xl p-4 shadow-sm hover:shadow-md transition-shadow';
        card.innerHTML = `
          <div class="flex items-start justify-between">
            <div>
              <h3 class="text-lg font-bold">${item.Commodity} <span class="text-gray-500 text-sm">(${item.Variety || '—'})</span></h3>
              <p class="text-sm text-gray-600 dark:text-gray-300">${item.Market}, ${item.District}, ${item.State}</p>
            </div>
            <span class="text-xs px-2 py-1 rounded bg-emerald-100 text-emerald-700 dark:bg-emerald-900/30 dark:text-emerald-300">Modal ₹${formatINR(modal)}</span>
          </div>
          <div class="mt-3">
            <div class="h-2 w-full rounded bg-gradient-to-r from-green-200 via-yellow-200 to-red-200 relative">
              <div class="absolute -top-1 h-4 w-0.5 bg-gray-700" style="left:${modalPos}%"></div>
            </div>
            <div class="grid grid-cols-3 gap-2 mt-2 text-xs">
              <div class="bg-green-50 dark:bg-green-900/20 p-2 rounded">Min<br><span class="font-semibold">₹${formatINR(min)}</span></div>
              <div class="bg-yellow-50 dark:bg-yellow-900/20 p-2 rounded">Modal<br><span class="font-semibold">₹${formatINR(modal)}</span></div>
              <div class="bg-red-50 dark:bg-red-900/20 p-2 rounded">Max<br><span class="font-semibold">₹${formatINR(max)}</span></div>
            </div>
          </div>
        `;
        fragment.appendChild(card);
      });
      resultsContainer.appendChild(fragment);
      currentPage = nextPage;
      if (lastData.length <= currentPage * PAGE_SIZE) loadMoreBtn.classList.add('hidden');
    });
  }

  // Initial render for better UX
  applyAndRender();